INSERT INTO `pages_page` VALUES (1,'privacy-policy','Privacy policy','<p style=\"text-align: center\">\r\n\r\nOcean Hunter Terms of Service and Privacy Policy</br>\r\n\r\n1. Terms</br>\r\n\r\n  By accessing the website at http://oceanhunter.node.co.nz, you are agreeing to be bound by these terms of service, all applicable laws and regulations, and agree that you are responsible for compliance with any applicable local laws. If you do not agree with any of these terms, you are prohibited from using or accessing this site. The materials contained in this website are protected by applicable copyright and trademark law.</br>\r\n\r\n2. Use License</br>\r\n\r\n\r\n\r\n      Permission is granted to temporarily download one copy of the materials (information or software) on Ocean Hunter\'s website for personal, non-commercial transitory viewing only. This is the grant of a license, not a transfer of title, and under this license you may not:</br>\r\n\r\n\r\n        modify or copy the materials;</br>\r\n        use the materials for any commercial purpose, or for any public display (commercial or non-commercial);\r\n        attempt to decompile or reverse engineer any software contained on Ocean Hunter\'s website;\r\n        remove any copyright or other proprietary notations from the materials; or\r\n        transfer the materials to another person or \"mirror\" the materials on any other server.</br>\r\n\r\n\r\n    This license shall automatically terminate if you violate any of these restrictions and may be terminated by Ocean Hunter at any time. Upon terminating your viewing of these materials or upon the termination of this license, you must destroy any downloaded materials in your possession whether in electronic or printed format.</br>\r\n\r\n\r\n3. Disclaimer</br>\r\n\r\n\r\n    The materials on Ocean Hunter\'s website are provided on an \'as is\' basis. Ocean Hunter makes no warranties, expressed or implied, and hereby disclaims and negates all other warranties including, without limitation, implied warranties or conditions of merchantability, fitness for a particular purpose, or non-infringement of intellectual property or other violation of rights.</br>\r\n    Further, Ocean Hunter does not warrant or make any representations concerning the accuracy, likely results, or reliability of the use of the materials on its website or otherwise relating to such materials or on any sites linked to this site.\r\n  </br>\r\n\r\n4. Limitations</br>\r\n\r\n  In no event shall Ocean Hunter or its suppliers be liable for any damages (including, without limitation, damages for loss of data or profit, or due to business interruption) arising out of the use or inability to use the materials on Ocean Hunter\'s website, even if Ocean Hunter or a Ocean Hunter authorized representative has been notified orally or in writing of the possibility of such damage. Because some jurisdictions do not allow limitations on implied warranties, or limitations of liability for consequential or incidental damages, these limitations may not apply to you.\r\n</br>\r\n5. Accuracy of materials</br>\r\n\r\n  The materials appearing on Ocean Hunter\'s website could include technical, typographical, or photographic errors. Ocean Hunter does not warrant that any of the materials on its website are accurate, complete or current. Ocean Hunter may make changes to the materials contained on its website at any time without notice. However Ocean Hunter does not make any commitment to update the materials.</br>\r\n\r\n6. Links</br>\r\n\r\n  Ocean Hunter has not reviewed all of the sites linked to its website and is not responsible for the contents of any such linked site. The inclusion of any link does not imply endorsement by Ocean Hunter of the site. Use of any such linked website is at the user\'s own risk.\r\n</br>\r\n7. Modifications</br>\r\n\r\n  Ocean Hunter may revise these terms of service for its website at any time without notice. By using this website you are agreeing to be bound by the then current version of these terms of service.</br>\r\n\r\n8. Governing Law</br>\r\n\r\n  These terms and conditions are governed by and construed in accordance with the laws of New Zealand and you irrevocably submit to the exclusive jurisdiction of the courts in that State or location.</br>\r\n\r\nPrivacy Policy</br>\r\n\r\n  Your privacy is important to us.</br>\r\n\r\n  It is Ocean Hunter\'s policy to respect your privacy regarding any information we may collect while operating our website. Accordingly, we have developed this privacy policy in order for you to understand how we collect, use, communicate, disclose and otherwise make use of personal information. We have outlined our privacy policy below.</br>\r\n\r\n\r\n    We will collect personal information by lawful and fair means and, where appropriate, with the knowledge or consent of the individual concerned.</br>\r\n    Before or at the time of collecting personal information, we will identify the purposes for which information is being collected.</br>\r\n    We will collect and use personal information solely for fulfilling those purposes specified by us and for other ancillary purposes, unless we obtain the consent of the individual concerned or as required by law.</br>\r\n    Personal data should be relevant to the purposes for which it is to be used, and, to the extent necessary for those purposes, should be accurate, complete, and up-to-date.</br>\r\n    We will protect personal information by using reasonable security safeguards against loss or theft, as well as unauthorized access, disclosure, copying, use or modification.</br>\r\n    We will make readily available to customers information about our policies and practices relating to the management of personal information.</br>\r\n    We will only retain personal information for as long as necessary for the fulfilment of those purposes.</br>\r\n\r\n\r\n  We are committed to conducting our business in accordance with these principles in order to ensure that the confidentiality of personal information is protected and maintained. Ocean Hunter may change this privacy policy from time to time at Ocean Hunter\'s sole discretion.</br>\r\n</p>','pages/page.html',1,1000,'published','2016-12-13 13:50:51','2016-12-15 00:09:45','2016-12-13 13:50:51','2016-12-13 13:49:46'),(2,'rules-conditions','Rules and Conditions','<h2>Ocean Hunter Summer Slam Spearfishing Competition</h2>\r\n\r\n<p>The species lists are divided into 3 groups plus Kingfish</p>\r\n\r\n<p>The 2016 competition commences December 22nd 2016 and closes March 27th 2017 at 6pm</p>\r\n\r\n<p>Winners or updates will be posted within 7 days of competition finishing.</p>\r\n\r\n<p>\r\n<strong>Species Groups:</strong><br />\r\nYou can only enter one group PLUS Kingfish. You may only enter 3 of each species within each group.\r\n</p>\r\n\r\n<p><u>For example:</u> Group one, you may enter a maximum of 3 Snapper, 3 Terakihi, 3 Giant Boarfish, 3 Pink Mao Mao, 3 Trevally and 3 John Dory</p>\r\n\r\n<p>\r\n<strong>Group One -</strong>\r\nSnapper, Tarakihi, Giant Boarfish, Pink Mao Mao, Trevally, John Dory\r\n</p>\r\n\r\n<p>\r\n<strong>Group Two -</strong>\r\nSnapper, Butterfish, Porae, Kahawai, Trevally, John Dory\r\n</p>\r\n\r\n<p>\r\n<strong>Group Three -</strong>\r\nBlue Cod, Tarakihi, Butterfish, Blue Moki, Kahawai,Trevally</p>\r\n\r\n<p>Kingfish are automatic entry for all.</p>\r\n\r\n<p><strong>Who can enter: Anyone!</strong></p>\r\n\r\n<p>\r\n<strong>Open Team -</strong>\r\nThe Open Team must have a minimum of two people and a maximum of four.\r\nYour team members must be competing in the same species group which is one, two or three.\r\n<strong>You cannot enter Kingfish as a team</strong>, Kingfish points are separate and for individual spearo’s only.\r\n</p>\r\n\r\n<p>Your team may only enter 3 of each species within your chosen group (see species group example above). The combined fish total will be divided by the number of spearo’s in your team. Team points will be based on your total average weight.</p>\r\n\r\n<p>\r\n<strong>Open Spearo -</strong>\r\nYou must be 18 years of age on entering; your total catch will be used to calculate your points. (If you are in a team as well, your points will be added to your team score automatically)\r\n</p>\r\n\r\n<p>\r\n<strong>Top Junior Diver - 18 years and under Male and Female</strong>\r\nYou must be under 18 years of age; your total catch will be used to calculate your points.\r\n(If you are in a team as well, your points will be added to your team score automatically)\r\n</p>\r\n\r\n<p>\r\n<strong>NOTE:</strong> If you spear a bigger fish and you have reached your maximum amount of entries, you are allowed to change your already entered fish by deleting an existing entry and replacing it with your bigger catch. This is called “upgrading”. The software will recalculate your new score.\r\n</p>\r\n\r\n<p>Once entered into a species group you cannot change. You cannot create a team after 01/02/2017</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<h2>The Rules</h2>\r\n\r\n<p>All fish must be legal and to current fisheries regulations relating to your area.</p>\r\n\r\n<ul>\r\n  <li>The heaviest fish prizes will be won by the heaviest weight per individual fish entered.</li>\r\n  <li>Minimum weight for all fish weighed is 500grams</li>\r\n  <li>Fish can be weighed complete, or if you choose you can gut and gill to conserve your catch.</li>\r\n  <li>No Scuba is allowed to be used to take any fish in this competition.</li>\r\n  <li>To enter a fish you must weigh your fish on digital scales.</li>\r\n  <li>You must enter the fish within 14 days of capture to be eligible for entry.</li>\r\n  <li>You must have a witness to verify your catch</li>\r\n  <li>You must enter online using the “enter my fish” section</li>\r\n</ul>\r\n\r\n\r\n<p>\r\n<strong>Important:</strong>\r\n</p>\r\n\r\n<p>\r\n<strong>Loading a fish into the Competition</strong>\r\n</p>\r\n\r\n<p>\r\n  <strong>You need to take two photo’s (see examples below)</strong>\r\n</p>\r\n\r\n<p>\r\n  The photo you upload must clearly show the following\r\n\r\n  <ul>\r\n    <li>The complete fish</li>\r\n    <li>The weight on digital scales</li>\r\n    <li>The person who speared the fish</li>\r\n  </ul>\r\n</p>\r\n\r\n<p>Please keep the original photo in high resolution until the competition closes. If we require it for confirmation we will ask you for it, if you cannot supply then your entry maybe refused.</p>\r\n\r\n<p>Load the following photo as your entry</p>\r\n<img src=\"/static/img/weighing-photo1.png\" />\r\n\r\n<p>Keep this second photo just in case we ask you for it.</p>\r\n<img src=\"/static/img/weighing-photo2.png\" />\r\n<br /><br />\r\n\r\n<p>\r\n<strong>The following system for allocating points will apply</strong></p>\r\n\r\n<p>The heaviest of each species in the group will get 100 points, example the biggest snapper if 10kg will get 100 points and the biggest John Dory if 2kg will get 100 points The next fish down will get a percentage of the highest points, example an 8kg snapper would get 80 points. If a bigger snapper is shot say 11kg, then they get the 100points and the snapper below it will receive a percentage of the heaviest fish.</p>\r\n\r\n<p>This will apply to King fish as well.</p>\r\n\r\n\r\n<p>\r\n<strong>PRIZE CATEGORIES</strong>\r\n</p>\r\n\r\n<p>\r\n<strong>Group One, Two, Three Awarded</strong> for Highest Points Overall<br />\r\n<strong>1st $400, 2nd $300, 3rd $200</strong> Placing Open Team<br />\r\n<strong>1st $500, 2nd $300, 3rd $200</strong> Placing Top Diver Open Spearo 18 +<br />\r\n<strong>1st $300, 2nd $200, 3rd $100</strong> Placing Top Junior Diver - under 18 at the time of entry</p>\r\n\r\n<p>\r\n<strong>Heaviest fish for each and every individual species (12 species in total)</strong><br />\r\n<strong>1st $200, 2nd $100</strong> Placing Top Diver Open Spearo 18 +\r\n<strong>1st $200, 2nd $100</strong> Placing Top Junior Diver - under 18 at the time of entry\r\n</p>\r\n\r\n<p>\r\n  <strong>Heaviest Kingfish</strong><br />\r\n  <strong>1st Prize $500</strong><br />\r\n  <strong>Heaviest combined weight total of Kingfish (maximum of 3 kingfish)</strong><br />\r\n  <strong>1st Prize $500</strong>\r\n</p>\r\n\r\n<p>Ocean Hunter reserves the right to change any of the prize categories at any time.</p>\r\n\r\n<p><strong>Finer details</strong></br>\r\nPrizes will be issued with Ocean Hunter vouchers, these can be redeemed online or instore, once issued these vouchers must be redeemed within 90 days or they will expire. Vouchers once issued cannot be changed they cannot be split and cannot be combined with other vouchers. A team voucher will be issued to one of the team members and it is up to the team to organise between them how they will spend the voucher.\r\n</p>\r\n\r\n<p>Within the competition there is the ability to protest a fish if you believe it to be not eligible. The final results of this competition will not be published until all protests have been finalised.\r\n</p><p>\r\nOcean Hunter Ltd reserves the right to cancel any fish entered if it believes it to be fake, un-true or any fish whose weight we think has been incorrectly represented.\r\n</p><p>\r\nBreach of any fisheries laws and regulations, or suspected breach, will be sufficient grounds for disqualification.\r\n</p><p>\r\nAll local fisheries regulations must be complied with. Proof or suspicion of cheating will be sufficient grounds for disqualification. Ocean Hunter Ltd reserves the right to disqualify competitors for any reason they see fit. Users who are disqualified may be disqualified for life and unable to enter any future Ocean Hunter Ltd competitions.\r\n</p><p>\r\nOcean Hunter Ltd has a zero tolerance policy against cheating, abuse or negative comments toward their competitors, sponsors. The promotion of other business’s or industry related brands or products within this competition without the written authorisation from Ocean Hunter management are not allowed. Failure to comply with this will result in your entry\\team being disqualified.\r\n</p><p>\r\nBy participating in the competition, you are agreeing to indemnify Ocean Hunter Ltd, its employees, Directors and Sponsors of damages of any kind, and you understand that spear-fishing is an inherently dangerous activity which you undertake at your own risk. We also encourage that you endeavour to take out medical and life insurance before spear-fishing.\r\n</p><p>\r\nOcean Hunter Ltd accepts no responsibility in any way for your failure to cover yourself for accidents that arise while you are spearfishing. Ocean Hunter Ltd can cancel this competition at any time for any reason.\r\n</p><p>\r\nWe advise, never dive alone, and always dive within your limits.\r\n</p>\r\n','pages/page.html',1,1000,'published','2016-12-13 13:51:10','2016-12-18 22:52:28','2016-12-13 13:51:10','2016-12-13 13:50:53');
